import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import '../../css/Nav.css';

class Nav extends Component {

  render() {
    const pages = [
      'About',
      'Web',
      'Music',
      'Visual',
    ]

    return (
      <div className="Nav">
        <NavLink
          to={`/`}
          exact

          className="NavLink"
          activeClassName="ActiveNavLink"
        >
          Home
        </NavLink>
        {this.renderNavLinks()}
        {pages.map(this.renderNavlink)}
      </div>
    );
  }

  ///////////////

  renderNavLinks = () => {
    // return (pages.map(page => ))
  }

  renderNavlink = (page) => {

    return (
      <NavLink
        to={`/${page.toLowerCase()}`}
        exact

        className="NavLink"
        activeClassName="ActiveNavLink"
        key={page}
      >
        {page}
      </NavLink>
    )
  }
}

export default Nav;
